import React from "react";
import VideoTitle from "./VideoTitle";

const VideoBackground =()=>{
    return(
        <div className='w-[vw] overflow-hidden'>
            <VideoTitle/>
          <div >
          <iframe width="560" height="315" src="https://www.youtube.com/embed/ulZBNRlXW7A?si=pXA9KdKu8nn3htmt&autopla" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share" referrerpolicy="strict-origin-when-cross-origin" allowfullscreen></iframe>
                  </div>
        </div>
        
    )
}
export default VideoBackground
